import React, { useState } from 'react'
import ReactDOM from 'react-dom'

/// consts ///

const Good = props => <div>{props.value}</div>
const Button = (props) => (
  <button onClick={props.handleClick}>
    {props.text}
  </button>
)


/// MAIN APP ///
const App = () => {
  const [value, setValue] = useState(0)

  const [good, setGood] = useState(0)

  const setToValue = newValue => {
    setValue(newValue)
  }

  return (
    <div>
      <h1>Give feedback</h1>
      <Button handleClick={() => setToValue(value + 1)} text="good" />
      <h2>Statistics</h2>
      <p>good <Display value={value} /></p>
    </div>
  )
}


/// render in DOM ///

ReactDOM.render(
  <App />, 
  document.getElementById('root')
)
